import React from 'react';
import './App.css';

import Header from './Header'
import Footer from './Footer'

import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div className="App">
        <h1> KAZI</h1>

      <Header title="1st head"/>
      <Header title="2st head"/>
      <Header title="3st head"/>
      <Header title="4st head"/>
      <Header/>
      <Footer name="kazi"/>
      <Footer name="musharraf"/>
      <Footer name="mk"/>
      <Header title="last head"/>
    </div>
  );
}

export default App;
